    return(
        <div className="main">
            <div className="borrowed container">
                <HashRouter>
                <Link to="/BorrowedList"><img src={borrowedImg} alt="wypożyczone"/></Link>
                </HashRouter>
                <h2>wypożyczone</h2>
                <p>zapisz, żeby nie zapomnieć</p>
            </div>
        </div>
    )
};
